/** åŸºäºtr.getMetaå†³å®šadd/remove decoration
 * - æ¯æ¬¡éƒ½è¦ç”¨decorationSet.map()æ›´æ–°decosçš„è§†å›¾å’Œä½ç½®
 */
const placeholderPlugin = new Plugin({
  state: {
    init() {
      return DecorationSet.empty;
    },
    apply(tr, set) {
      // Adjust decoration positions to changes made by the transaction
      set = set.map(tr.mapping, tr.doc);
      // See if the transaction adds or removes any placeholders
      // @ts-ignore thisåº”è¯¥æŒ‡å‘å½“å‰Pluginå¯¹è±¡
      const action = tr.getMeta(this);
      if (action && action.add) {
        const widget = document.createElement('placeholder');
        const deco = Decoration.widget(action.add.pos, widget, {
          id: action.add.id,
        });
        set = set.add(tr.doc, [deco]);
      }
      if (action && action.remove) {
        set = set.remove(
          set.find(null, null, (spec) => spec.id === action.remove.id),
        );
      }
      return set;
    },
  },
  props: {
    decorations(state) {
      return this.getState(state);
    },
  },
});

/** returns the current position of the placeholder with the given ID */
function findPlaceholder(state: EditorState, id: {}) {
  const decos = placeholderPlugin.getState(state);
  const found = decos.find(null, null, (spec) => spec.id === id);
  return found.length ? found[0].from : null;
}

/** ç‚¹å‡»ä¸Šä¼ æŒ‰é’®æ—¶ï¼Œå…ˆåˆ é™¤é€‰åŒºï¼Œç„¶ååœ¨trä¸­è®¾ç½®addå‚æ•°ï¼ŒdispatchTr, æ­¤æ—¶ä¼šæ˜¾ç¤ºå›¾ç‰‡å ä½ç¬¦decoId
 * - æ¥ç€è§¦å‘ä¸Šä¼ å¼‚æ­¥é€»è¾‘
 * - ä¸Šä¼ å®Œæˆæ—¶ï¼Œåœ¨stateä¸­æ‰¾åˆ°decoIdï¼Œå°†è¯¥ä½ç½®æ›¿æ¢ä¸ºimg-nodeï¼ŒdispatchTr
 * - â“ ä¸ºä»€ä¹ˆidä¸ç”¨å­—ç¬¦ä¸²
 */
function startImageUpload(view: EditorView, file: File) {
  // A fresh object to act as the ID for this upload
  const id = {};

  // Replace the selection with a placeholder
  const tr = view.state.tr;
  if (!tr.selection.empty) tr.deleteSelection();
  tr.setMeta(placeholderPlugin, { add: { id, pos: tr.selection.from } });
  view.dispatch(tr);

  uploadFile(file).then(
    (url) => {
      const pos = findPlaceholder(view.state, id);
      // If content around the placeholder has been deleted, drop the image
      if (pos == null) return;
      // Otherwise, insert it at placeholder's position, and remove the placeholder
      view.dispatch(
        view.state.tr
          .replaceWith(pos, pos, schema.nodes.image.create({ src: url }))
          .setMeta(placeholderPlugin, { remove: { id } }),
      );
    },
    () => {
      // On failure, just clean up the placeholder
      view.dispatch(tr.setMeta(placeholderPlugin, { remove: { id } }));
    },
  );
}

/** This is just a dummy that loads the file and creates a data URL.
 * You could swap it out with a function that does an actual upload
 * and returns a regular URL for the uploaded file.
 */
function uploadFile(file: File) {
  const reader = new FileReader();
  return new Promise((resolve, reject) => {
    reader.onload = () => resolve(reader.result);
    reader.onerror = () => reject(reader.error);
    // Some extra delay to make the asynchronicity visible
    setTimeout(() => reader.readAsDataURL(file), 2500);
  });
}

